import React from "react";
import { Button, Container, Row, Column } from "react-bootstrap";
import Form from 'react-bootstrap/Form';
import './Login.css';
import NavbarHome from "../../components/NavbarHome";
import FooterHome from "../../components/FooterHome";

export default function Login() {
  return (
    <div>
      <Container>
      <NavbarHome />
      <div className="container-fluid">
        <div className="row">
          <div className="col-md-4 leftDiv">
            <Form>
              <Form.Group className="mb-3" controlId="formGroupUsername">
                <Form.Label>Username</Form.Label>
                <Form.Control type="text" placeholder="Enter username" />
              </Form.Group>
              <Form.Group className="mb-3" controlId="formGroupPassword">
                <Form.Label>Password</Form.Label>
                <Form.Control type="password" placeholder="Password" />
              </Form.Group>
              <Button variant="primary" type="submit" style={{ width: '100%' }}>
                Login
              </Button>
            </Form>
          </div>
          <div className="col-md-8 rightDiv" style={{ backgroundImage: 'url("images/homebackground.png")', backgroundSize: 'cover', minHeight: '100vh' }}></div>
        </div>
      </div>
      <FooterHome />
      </Container>
    </div>
  );
}
